import React, {Children, useEffect} from 'react'
import './styles/App.css';
import axios from "axios";
import Loader from "./Loader";
import Modal from "./Modals/Modal"
import MainHeader from "./Components/Visuals/MainHeader";
import async from "async";

function App() {
    const [items, setItems] = React.useState(  [])
    const [loading, setLoading] = React.useState(true)

    useEffect(() => {
        fetch("http://localhost:8080/prometheus/fxspot/getAll")
            .then(response => response.json())
            .then(data => setItems(data)).then(data => console.log(data));
    }, []);

    const listItems = items.map((d) => <ul><li key={d.id}>{d.id}</li>
        <li key={d.name}>{d.name}</li>
        <li key={d.spotRate }>{d.spotRate }</li>
    </ul>);



    return (

        <div className="wrapper">

            <div className="sidebar">
                <div>
                    <MainHeader/> &nbsp;
                    <button className="start">
                        Start!
                    </button>
                    &nbsp;
                    <Modal/> &nbsp;
                    {/* eslint-disable-next-line array-callback-return */}
                    {listItems}

                </div>
            </div>
            <div className="main-slide">
                <div className="bg">

                </div>
            </div>


            {/*{loading && <Loader/>}*/}


        </div>

    );
}

export default App;
